import React from "react";
import { Container, Box } from "@chakra-ui/react";
const Homepage = () => {
  return (
    <Container maxW="xl" centerContent>
      <Box d="flex" justifyContent="center" p={3} bg>
        <Text>Chatting Application</Text>
      </Box>
      <Box></Box>
    </Container>
  );
};

export default Homepage;
